import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class CarService {

  endpoint = 'http://localhost:8080/car';

  constructor(private  httpClient: HttpClient) { }

  getCars(){
    return this.httpClient.get(this.endpoint);
  }

  add(car : any){
    let body = new URLSearchParams();
    body.append("modelo", car.modelo);
    body.append("marca", car.marca);
    body.append("precio", car.precio.toSting());
    body.append("descripcion", car.descripcion);

    return this.httpClient.post(endPoint, body, httpOptions);
  }
}
